// src/App.js

import React from 'react';
import './Main.css';

// Navbar Component
const Navbar = () => {
    return (
        <nav className="navbar">
            <h2>My Navbar</h2>
            <ul>
                <li><a href="/">Home</a></li>
                <li><a href="/dashboard">Dashboard</a></li>
            </ul>
        </nav>
    );
};

// Header Component
const Header = () => {
    return (
        <header>
            <h1>Project Dashboard</h1>
        </header>
    );
};

// ProjectCard Component
const ProjectCard = ({ project }) => {
    return (
        <div className="project-card">
            <h2>{project.name}</h2>
            <p>{project.description}</p>
            <div className="progress-bar">
                <div className="progress" style={{ width: `${project.progress}%` }}>
                    {project.progress}%
                </div>
            </div>
        </div>
    );
};

// ProjectList Component
const ProjectList = () => {
    const projects = [
        { name: 'Project A', description: 'Description of project A', progress: 70 },
        { name: 'Project B', description: 'Description of project B', progress: 45 },
        { name: 'Project C', description: 'Description of project C', progress: 85 },
    ];

    return (
        <div className="project-list">
            {projects.map((project, index) => (
                <ProjectCard key={index} project={project} />
            ))}
        </div>
    );
};

// Main App Component
const App = () => {
    return (
        <div className="app">
            <Navbar />
            <Header />
            <ProjectList />
        </div>
    );
};

export default App;
